const timer = {
	pomodoro: 25,
	shortBreak: 5,
	longBreak: 15,
	sessions: 0
};

// Control Button is the Play, Pause while Mode Buttons are the Pomodoro, Short Break, Long Break buttons
const controlButton = document.querySelector("#controlButton"), 
   	resetButton = document.querySelector("#resetButton"),
    modeButton = document.querySelector("#mode-buttons"),
	audioLinks = document.querySelectorAll(".audioLinks");

let isTimerRunning = false,
    audio = new Audio(),
	isAudioPlaying = false,
	interval;

audio.loop = true;

controlButton.addEventListener("click", setupControlButton);
resetButton.addEventListener('click', resetTimer);
modeButton.addEventListener('click', handleMode);
audioLinks.forEach((audio) => audio.addEventListener('click', selectAudio));

function setupControlButton() {
	const control = controlButton.dataset.control;
	switch (control) {
		case 'start':
			if (timer.mode === "pomodoro") {
				playAudio();
				isAudioPlaying = true;
			}
			startTimer();
			break;
		case'stop':
			// Stops the audio
			if (timer.mode === "pomodoro") {
				pauseAudio();
				isAudioPlaying = false;
			}
			stopTimer();
			break;
	}
}
    
function startTimer()  {
	controlButton.dataset.control  = 'stop';
	controlButton.classList.remove("fa-play");
	controlButton.classList.add("fa-pause");

	isTimerRunning = true;
	interval = setInterval(function() {
		timer.remainingTime--;;
		updateClock();

		remainingTime = timer.remainingTime;
		if (remainingTime < 0) {
			isTimerRunning = false;
			clearInterval(interval);
			if (timer.mode === 'pomodoro') {
				timer.sessions++;
				document.querySelector("#pomodoroCount").textContent = 	`Pomodoro: ${timer.sessions}`;
				timer.sessions % 4 == 0 ? switchMode('longBreak') : switchMode('shortBreak');
			}
			else {
				switchMode('pomodoro');
			}
			breakSound();
			stopTimer();
		}
	}, 1000); 
}

function stopTimer() {
	controlButton.dataset.control  = 'start';
	controlButton.classList.remove("fa-pause");
	controlButton.classList.add("fa-play");
	clearInterval(interval);
}

function resetTimer() {
	if (isTimerRunning === true) {
		if (confirm("Are you sure you want to reset? The remaining time will not be tallied in the report.") === true) {
			stopTimer();
			pauseAudio();
			switchMode(timer.mode);
			isTimerRunning = false;
		}
		else {
			clearInterval(interval);
			playAudio();
			startTimer();
		}
	}
}

function updateClock() {
	let minutes = Math.floor(timer.remainingTime / 60);
	let seconds = timer.remainingTime % 60;

	minutes = minutes.toString().padStart(2, "0");
	seconds = seconds.toString().padStart(2, "0");
	document.getElementById('minutes').innerHTML = minutes;
	document.getElementById('seconds').innerHTML = seconds;

	const titleMsg = (timer.mode === 'pomodoro') ? 'Time to work!' : 'Take a break!'
	document.title = `${minutes}:${seconds} - ${titleMsg}`;
}

function switchMode(mode) {
	// Stops the audio when you switch mode from pomodoro to shortBreak or longBreak.
	// This is the error if if-statement is not playing: DOMException: play() failed because the user didn't interact with the document first.
	if (isAudioPlaying) {
		pauseAudio();
	}
	timer.mode = mode;
	timer.remainingTime = timer[mode] * 60;

	const currentMode = document.getElementsByClassName("active");
	currentMode[0].className = currentMode[0].className.replace(" active", "")
	document.querySelector(`#${mode}`).classList.add("active");

	updateClock();
}

function handleMode(event) {
	const mode = event.target.id;
	// First if-statement asks if the timer is currently running. 
	if (isTimerRunning === true) {
		if (confirm('Are you sure you want to switch?') === true) {
			stopTimer();
			isTimerRunning = false;
			switchMode(mode);
			return;
		}
		else {
			clearInterval(interval);
			playAudio();
			startTimer();
			return;
		}
	}
	if (mode === "mode-buttons") return;

	switchMode(mode);
	stopTimer();
}

// Sound that plays whenever you finish a mode.
function breakSound() {
	var breakSound = new Audio("data:audio/mpeg;base64,");  
	breakSound.play();
}

function selectAudio() {
	if(event.target.id==='none') {
		audio.muted = true;
		return;
	}
	audio.muted = false;
	audio.src = `./assets/audio/${event.target.id}.mp3`
}

// To fix the error: The play() request was interrupted by a call to pause(). Saw this in StackOverflow.
// This pauses the audio currently playing.
function pauseAudio() {
	var thePromise = audio.play();
	if (thePromise != undefined) {
		thePromise.then(function() {
			audio.pause();
		});
	}
}

function playAudio() {
	if (timer.mode === "pomodoro") {
		audio.play();
	}
}

// hides the dropup after selecting an audio
window.onclick = function() {
	if (event.target.id !== 'musicButton') {
		document.querySelector('.dropdown-content').classList.remove('show');
	}
	else {
		document.querySelector('.dropdown-content').classList.add('show');
	}
}

// Initializes the mode at Pomodoro
window.onload = switchMode('pomodoro');

// Asks the user if he wants to leave the web app
window.onbeforeunload = function(){
	if (isTimerRunning)
		return 'message'
	else
		window.onbeforeunload = null;
}





